


CREATE TABLE probility (
  wayname varchar(16),
  fhour int,
  p10 float,
  p20 float,
  p30 float,
  p40 float,
  p50 float,
  p60 float,
  p70 float,
  p80 float,
  p90 float,
  p100 float,
  error float,
  remark varchar(200));







CREATE TABLE  typhoon (
  id int NOT NULL ,
  nno varchar(11),
  shuoming varchar(120),
  yyyy int,
  mon int,
  day int,
  hh int,
  fhour int,
  lon float,
  lat float,
  wind int,
  pressure int,
  xx1 int,
  xx2 int,
  xx3 int,
  xx4 int,
  way varchar(4));





